import React from 'react';
import day from '../images/5day.png';
import current from '../images/currentweather.png';
import { Link } from '@reach/router';

const Home = () => {
    return <div className="home">
        <Link className="current" to="/current">
          <img src={current} alt={'current weather screenshot'} />
        </Link>
        <img src={day} className="day" alt={'5 day screenshot'} />
      </div>;
};

export default Home;
